            {/* Add more columns if needed */}
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Data 1</td>
            <td>Data 2</td>
            {/* Add more data cells if needed */}
          </tr>
        </tbody>
      </table>
    </div>
  </div>
